class bootrom(object):
    import binascii

    def __init__(self):
        self.__fpointer = 0
        self.__size = len(self.BOOTROM)

    def open(self, filename='', mode='r'):
        self.__fpointer = 0

    def close(self):
        self.__fpointer = 0

    def tell(self):
        return self.__fpointer

    def seek(self, offset, start=0):
        if start == 1:
            start = self.__fpointer
        elif start == 2:
            start = self.__size
        if start + offset < 0:
            raise OSError(22,'Invalid argument')
        else:
            self.__fpointer = start + offset
            return self.__fpointer

    def get_size(self):
        return self.__size

    def read(self, size=0):
        if size == 0:
            size = self.__size - self.__fpointer
        if self.__fpointer >= self.__size:
            return b''
        else:
            fpointer = self.__fpointer
            self.__fpointer = fpointer + size

        if fpointer + size >= self.__size:
            return self.BOOTROM[fpointer:self.__size]
        else:
            return self.BOOTROM[fpointer:self.__fpointer]

    BOOTROM=binascii.a2b_base64(b"""""")
